import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import HomeTab from './HomeTab';
import Navigation from './Navigation';
import Board from './Board';
import PinVerification from './PinVerification';  // Import PinVerification
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      selectedTab: 'home',
      isUnlocked: false,
      clients: {
        backlog: [],
        inProgress: [],
        complete: [],
      },
      userId: null,
    };
  }

  componentDidMount() {
    this.fetchClients();
  }

  fetchClients = async () => {
    try {
      const response = await fetch('/api/v1/clients');
      const data = await response.json();

      this.setState({
        clients: {
          backlog: data.filter(c => c.status === 'backlog'),
          inProgress: data.filter(c => c.status === 'in-progress'),
          complete: data.filter(c => c.status === 'complete'),
        },
      });
    } catch (error) {
      console.error('Failed to fetch clients:', error);
    }
  };

  updateClients = (updatedClients) => {
    this.setState({ clients: updatedClients });
  };

  changeTab = (tabName) => {
    if (tabName === 'home') {
      this.setState({ selectedTab: 'home', isUnlocked: false, userId: null });
    } else {
      this.setState({ selectedTab: tabName });
    }
  };

  handleUnlock = async (pin) => {
    try {
      const response = await fetch('/api/verify-pin', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ pin }),
      });

      const result = await response.json();

      if (response.ok && result.valid && result.userId) {
        this.setState({
          isUnlocked: true,
          selectedTab: 'shipping-requests',
          userId: result.userId,
        });

        // Save login history
        await fetch('/api/login-history', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({ userId: result.userId }),
        });

        this.fetchClients(); // refetch cards after login
      } else {
        alert('Invalid PIN. Please try again.');
      }
    } catch (error) {
      console.error('Error verifying PIN:', error);
      alert('An error occurred while verifying the PIN.');
    }
  };

  handleCardChange = async (cardID, oldStatus, newStatus, oldPriority, newPriority) => {
    try {
      await fetch(`/api/card-change-history`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          cardID,
          oldStatus,
          newStatus,
          oldPriority,
          newPriority,
        }),
      });

      // Update client in DB
      await fetch(`/api/v1/clients/${cardID}`, {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          status: newStatus,
          priority: newPriority,
        }),
      });

      this.fetchClients(); // refresh client board
    } catch (error) {
      console.error('Failed to update card:', error);
    }
  };

  renderShippingRequests() {
    return (
      <Board
        clients={this.state.clients}
        updateClients={this.updateClients}
        onCardChange={this.handleCardChange}
      />
    );
  }

  renderNavigation() {
    return (
      <Navigation
        onClick={this.changeTab}
        selectedTab={this.state.selectedTab}
        isUnlocked={this.state.isUnlocked}
      />
    );
  }

  renderTabContent() {
    const { selectedTab, isUnlocked } = this.state;
    if (selectedTab === 'shipping-requests' && isUnlocked) {
      return this.renderShippingRequests();
    }
    return (
      <PinVerification onUnlock={this.handleUnlock} /> // Use PinVerification for PIN validation
    );
  }

  render() {
    return (
      <div className="App">
        {this.renderNavigation()}
        <div className="App-body">
          {this.renderTabContent()}
        </div>
      </div>
    );
  }
}

export default App;





